import "./ListaOpciones.css";
const ListaOpciones = () => {
  // Method map -> array.map((team, index) => {return <option></option>})
  const teams = [
    "Programming",
    "Front End",
    "Data Science",
    "Devops",
    "UX & Design",
    "Mobile",
    "Innovation & Gestation",
  ];
  return (
    <div className="lista-opciones">
      <label>Teams</label>
      <select>
        {teams.map((team, index) => {
          return <option key={team}>{team}</option>;
        })}
      </select>
    </div>
  );
};

export default ListaOpciones;
